--
-- Table structure for table `locations`
--

CREATE TABLE IF NOT EXISTS `locations` (
  `loc_id` int(11) NOT NULL AUTO_INCREMENT,
  `loc_name` varchar(256) NOT NULL,
  `loc_parent` varchar(56) NOT NULL,
  `loc_size` int(11) NOT NULL,
  `loc_lat` double(6,3) NOT NULL,
  `loc_lon` double(6,3) NOT NULL,
  PRIMARY KEY (`loc_id`),
  KEY `loc_name` (`loc_name`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=42560 ;

